Tectonic’s support for Unicode allows it to take advantage of modern fonts that are distributed using formats such as OpenType . Besides opening up access to a whole world of typographic progress — a good font is the result of years of expert effort — this support positions Tectonic to create outputs in not just PDF but HTML formats. HTML capability is still under development, but it’s one of the prime reasons that the Tectonic project was started. The choice of fonts is foundational to TeX’s document processing, so modern fonts aren’t automatically activated. To start using a nice new font like TeX Gyre Pagella (derived from Palatino ), edit your src/_preamble.tex file and add the following lines after the \documentclass command: \usepackage{fontspec}
\setmainfont{texgyrepagella}[ Extension = .otf, UprightFont = *-regular, BoldFont = *-bold, ItalicFont = *-italic, BoldItalicFont = *-bolditalic,
] Now rebuild your document: $ tectonic -X build You’ll probably see Tectonic download some files: namely, the new font files that you have started using. Tectonic’s ability to fetch such files on the fly is why its installation is so much easier than a traditional TeX engine. If you open up your rebuilt document, it will be using your new font, although the difference can be difficult to detect with such a small amount of sample text.
